import '../../App.css';
import React from 'react';
import { ReactSVG } from 'react-svg';
import appliances from '../../svg/mainMenu/menuAppliances.svg';
import schedule from '../../svg/mainMenu/menuSchedule.svg';
import cancel from '../../svg/mainMenu/menuCancel.svg';
import energy from '../../svg/mainMenu/menuEnergy.svg';

function Menu() {
  // handle svg file with arrows
  return (
    <div>
    <div className="equi">
        <ReactSVG
        afterInjection={(error, svg) => {
          if (error) {
            console.error(error)
            return
          }
          console.log(svg)
        }}
        beforeInjection={(svg) => {
          svg.classList.add('svg-class-name')
          svg.setAttribute('style', 'width: 950')
        }}
        className="background"
        evalScripts="always"
        fallback={() => <span>Error!</span>}
        loading={() => <span>Loading</span>}
        renumerateIRIElements={false}
        src={appliances}
        useRequestCache={false}
        wrapper="div"/>
    </div>
        <div>
        <ReactSVG
        afterInjection={(error, svg) => {
          if (error) {
            console.error(error)
            return
          }
          console.log(svg)
        }}
        beforeInjection={(svg) => {
          svg.classList.add('svg-class-name')
          svg.setAttribute('style', 'width: 950')
        }}
        className="background"
        evalScripts="always"
        fallback={() => <span>Error!</span>}
        loading={() => <span>Loading</span>}
        renumerateIRIElements={false}
        src={schedule}
        useRequestCache={false}
        wrapper="div"/>
        <ReactSVG
        afterInjection={(error, svg) => {
          if (error) {
            console.error(error)
            return
          }
          console.log(svg)
        }}
        beforeInjection={(svg) => {
          svg.classList.add('svg-class-name')
          svg.setAttribute('style', 'width: 950')
        }}
        className="background"
        evalScripts="always"
        fallback={() => <span>Error!</span>}
        loading={() => <span>Loading</span>}
        renumerateIRIElements={false}
        src={cancel}
        useRequestCache={false}
        wrapper="div"/>
        <ReactSVG
        afterInjection={(error, svg) => {
          if (error) {
            console.error(error)
            return
          }
          console.log(svg)
        }}
        beforeInjection={(svg) => {
          svg.classList.add('svg-class-name')
          svg.setAttribute('style', 'width: 950')
        }}
        className="background"
        evalScripts="always"
        fallback={() => <span>Error!</span>}
        loading={() => <span>Loading</span>}
        renumerateIRIElements={false}
        src={energy}
        useRequestCache={false}
        wrapper="div"/>
      </div>
    </div>
  );
}

export default Menu;
